import React, { useState } from 'react';
import {
    Container,
    Paper,
    Typography,
    TextField,
    Button,
    Box,
    Alert,
    CircularProgress,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../../utils/supabaseClient';

export default function Register() {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({
        nameKana: '',
        userId: '',
        email: '',
        password: '',
        confirmPassword: '',
        referrerId: '',
        usdtAddress: '',
        walletType: '',
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [fieldErrors, setFieldErrors] = useState({});

    // バリデーション関数
    const validateField = (name, value) => {
        let error = '';
        switch (name) {
            case 'nameKana':
                if (!value) {
                    error = '名前（カタカナ）は必須です';
                } else if (!/^[\u30A0-\u30FF0-9a-zA-Z\s]+$/.test(value)) {
                    error = 'カタカナと半角英数字のみ使用できます';
                }
                break;
            case 'userId':
                if (!value) {
                    error = 'ユーザーIDは必須です';
                } else if (!/^[a-zA-Z0-9]{6,}$/.test(value)) {
                    error = 'ユーザーIDは半角英数字6文字以上で入力してください';
                }
                break;
            case 'email':
                if (!value) {
                    error = 'メールアドレスは必須です';
                } else if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(value)) {
                    error = '有効なメールアドレスを入力してください';
                }
                break;
            case 'password':
                if (!value) {
                    error = 'パスワードは必須です';
                }
                break;
            case 'confirmPassword':
                if (!value) {
                    error = 'パスワード（確認）は必須です';
                } else if (value !== formData.password) {
                    error = 'パスワードが一致しません';
                }
                break;
            case 'referrerId':
                if (!value) {
                    error = '紹介者IDは必須です';
                }
                break;
            case 'usdtAddress':
                if (value && !/^0x[a-fA-F0-9]+$/.test(value)) {
                    error = '有効なUSDTアドレス（BEP20）を入力してください';
                }
                break;
            default:
                break;
        }
        return error;
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });

        // リアルタイムバリデーション
        const error = validateField(name, value);
        setFieldErrors({
            ...fieldErrors,
            [name]: error
        });
    };

    // ユーザーID重複チェック
    const checkUserIdExists = async (userId) => {
        const { data, error } = await supabase
            .from('profiles')
            .select('user_id')
            .eq('user_id', userId)
            .single();

        return !!data;
    };

    // 紹介者ID存在チェック
    const checkReferrerExists = async (referrerId) => {
        const { data, error } = await supabase
            .from('profiles')
            .select('user_id')
            .eq('user_id', referrerId)
            .single();

        return !!data;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // すべてのフィールドのバリデーション
        const errors = {};
        Object.keys(formData).forEach(field => {
            const error = validateField(field, formData[field]);
            if (error) errors[field] = error;
        });

        if (Object.keys(errors).length > 0) {
            setFieldErrors(errors);
            return;
        }

        try {
            setLoading(true);
            setError('');

            // ユーザーID重複チェック
            const userIdExists = await checkUserIdExists(formData.userId);
            if (userIdExists) {
                setError('このユーザーIDは既に使用されています');
                return;
            }

            // 紹介者ID存在チェック
            const referrerExists = await checkReferrerExists(formData.referrerId);
            if (!referrerExists) {
                setError('指定された紹介者IDは存在しません');
                return;
            }

            // ユーザー登録
            const { data: authData, error: authError } = await supabase.auth.signUp({
                email: formData.email,
                password: formData.password,
            });

            if (authError) throw authError;

            // プロフィールの作成
            if (authData.user) {
                const { error: profileError } = await supabase
                    .from('profiles')
                    .insert([
                        {
                            id: authData.user.id,
                            name_kana: formData.nameKana,
                            user_id: formData.userId,
                            email: formData.email,
                            referrer_id: formData.referrerId,
                            usdt_address: formData.usdtAddress || null,
                            wallet_type: formData.walletType || null,
                            user_type: 'user'
                        }
                    ]);

                if (profileError) throw profileError;
            }

            alert('登録が完了しました。メールを確認してアカウントを有効化してください。');
            navigate('/');

        } catch (error) {
            setError(error.message);
            console.error('Error:', error.message);
        } finally {
            setLoading(false);
        }
    };

    return (
        <Container component="main" maxWidth="xs">
            <Box
                sx={{
                    marginTop: 8,
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                }}
            >
                <Paper elevation={3} sx={{ p: 4, width: '100%' }}>
                    <Typography component="h1" variant="h5" align="center" gutterBottom>
                        アカウント登録
                    </Typography>

                    {error && (
                        <Alert severity="error" sx={{ mb: 2 }}>
                            {error}
                        </Alert>
                    )}

                    <Box component="form" onSubmit={handleSubmit} sx={{ mt: 1 }}>
                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="nameKana"
                            label="名前（カタカナ）"
                            name="nameKana"
                            value={formData.nameKana}
                            onChange={handleChange}
                            error={!!fieldErrors.nameKana}
                            helperText={fieldErrors.nameKana}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="userId"
                            label="希望ユーザーID"
                            name="userId"
                            value={formData.userId}
                            onChange={handleChange}
                            error={!!fieldErrors.userId}
                            helperText={fieldErrors.userId}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="email"
                            label="メールアドレス"
                            name="email"
                            autoComplete="email"
                            value={formData.email}
                            onChange={handleChange}
                            error={!!fieldErrors.email}
                            helperText={fieldErrors.email}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            name="password"
                            label="パスワード"
                            type="password"
                            id="password"
                            autoComplete="new-password"
                            value={formData.password}
                            onChange={handleChange}
                            error={!!fieldErrors.password}
                            helperText={fieldErrors.password}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            name="confirmPassword"
                            label="パスワード（確認）"
                            type="password"
                            id="confirmPassword"
                            value={formData.confirmPassword}
                            onChange={handleChange}
                            error={!!fieldErrors.confirmPassword}
                            helperText={fieldErrors.confirmPassword}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="referrerId"
                            label="紹介者ID"
                            name="referrerId"
                            value={formData.referrerId}
                            onChange={handleChange}
                            error={!!fieldErrors.referrerId}
                            helperText={fieldErrors.referrerId}
                            disabled={loading}
                        />

                        <TextField
                            margin="normal"
                            fullWidth
                            id="usdtAddress"
                            label="USDTアドレス（BEP20）"
                            name="usdtAddress"
                            value={formData.usdtAddress}
                            onChange={handleChange}
                            error={!!fieldErrors.usdtAddress}
                            helperText={fieldErrors.usdtAddress}
                            disabled={loading}
                        />

                        <FormControl fullWidth margin="normal">
                            <InputLabel id="wallet-type-label">ウォレットタイプ</InputLabel>
                            <Select
                                labelId="wallet-type-label"
                                id="walletType"
                                name="walletType"
                                value={formData.walletType}
                                label="ウォレットタイプ"
                                onChange={handleChange}
                                disabled={loading}
                            >
                                <MenuItem value="">選択してください</MenuItem>
                                <MenuItem value="evo">EVOカード</MenuItem>
                                <MenuItem value="other">その他</MenuItem>
                            </Select>
                        </FormControl>

                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            sx={{ mt: 3, mb: 2 }}
                            disabled={loading}
                        >
                            {loading ? (
                                <CircularProgress size={24} color="inherit" />
                            ) : (
                                '登録'
                            )}
                        </Button>

                        <Box sx={{ mt: 2, textAlign: 'center' }}>
                            <Button
                                onClick={() => navigate('/')}
                                variant="text"
                                size="small"
                            >
                                すでにアカウントをお持ちの方
                            </Button>
                        </Box>
                    </Box>
                </Paper>
            </Box>
        </Container>
    );
}
